import React, { Component } from 'react'

export class Header extends Component {
    render() {
        return (
            <header>
                <div className="navbar">
                    <a className="active" href="#"> Home</a>
                    <a href="#"> Search</a>
                    <a href="#"> Contact</a>
                    <a href="#"> Login</a>
                </div>
            </header>
        )
    }
}

export default Header
